const WrappedLocalStorage={has:key=>localStorage.propertyIsEnumerable(key),get:key=>{let result=localStorage.getItem(key);try{result=JSON.parse(result)}catch(err){return result}return result},set:(key,value)=>{localStorage.setItem(key,JSON.stringify(value))},delete:key=>{localStorage.removeItem(key)},deleteAll:()=>{localStorage.clear()},getLength:()=>localStorage.length,checkEnabled:()=>{try{return"localStorage"in window&&null!==window.localStorage}catch(ex){return!1}}};export default WrappedLocalStorage;